import { useState } from "react";

const InfoPaneluserHome = () => {
    const [page, setPage] = useState("overview")

    const overviewFunc = () => {
        return (
            <span>Welcome to the Overview page!</span>
        )
    }

    const playTimeFunc = () => {
        return (
            <span>Welcome to the playtime page!</span>
        )
    }

    const content = () => {
        switch (page) {
            case "overview":
                return overviewFunc()
            case "playTime":
                return playTimeFunc()
            default:
                return overviewFunc()
        }
    }

    const handleClick = (e) => {
        setPage(e.target)
        console.log(e.target)
    }

    return (
        <div className="InfoPaneluserHomeContainer">
            <div className="InfoPaneluserHomeMenuContainer">
                <div className="InfoPaneluserHomeMenuContainerInner">
                    <p>MENU</p>
                    <div className="InfoPaneluserHomeMenuLine" />
                    <span name="overview" onClick={handleClick}>Overview</span>
                    <span name="createServer" style={{ color: "rgba(255,255,255,0.25)" }}>Creating a server</span>
                    <span name="logs" style={{ color: "rgba(255,255,255,0.25)" }}>Logs</span>
                    <span name="playTime" onClick={handleClick}>Play time</span>
                    <span name="serverSettings" style={{ color: "rgba(255,255,255,0.25)" }}>Changing server settings</span>
                    <span name="userSettings" style={{ color: "rgba(255,255,255,0.25)" }}>Changing user settings</span>
                </div>
            </div>
            <div className="InfoPaneluserHomeContentContainer">
                {content()}
                <div className="InfoPaneluserHomeContentTitleContainer">

                </div>
                <div className="InfoPaneluserHomeContentMainConatiner">

                </div>
            </div>
        </div>
    )
}

export default InfoPaneluserHome
